import "./ProductCard.css"

export const ProductCard = ({product: {id, name, thumbnail, price}}) => {
  return (
    <div className="product-container">
      <div>
        <img src={thumbnail} className="product-image" alt="" />
      </div>
      <hr />
      <p>{name}</p>
      <p>Rs {price}</p>
    </div>
  )
}
